import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWifi, faTv, faPhone } from '@fortawesome/free-solid-svg-icons';
import './HomePage-Style.css';

const HomePage = () => {
  return (
    <div>
      <header>
        <FontAwesomeIcon icon="far fa-crown" />      
        <h1>KaPN Customer List</h1>
      </header>
      <section>
        <h2>Explore Our Services</h2>
        <p>At Telco, we offer a wide range of telecommunications services to meet your needs. Whether you're looking for internet, TV, or phone services, we've got you covered.</p>
        <div className="service-items">
          <div className="service-item">
            <FontAwesomeIcon icon={faWifi} className="service-icon" />
            <h3>High-Speed Internet</h3>
            <p>Experience lightning-fast internet speeds with our reliable broadband connections.</p>
            <Link to="/internet" className="service-link">Learn More</Link>
          </div>

        </div>
      </section>

      <section>
        <h2>Contact Us</h2>
        <p>If you have any questions or need assistance, our support team is ready to help. Contact us today!</p>
        <Link to="/contact" className="contact-link">Contact Us</Link>
      </section>
      <footer>
        <p>&copy; {new Date().getFullYear()} KaPN. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default HomePage;
